import Layout from '../components/layout';
import About from '../components/home/about';
import ImgBanner from '../components/ui/imgBanner';
import styled from 'styled-components';
import TitleBanner from '../components/ui/titleBanner';

const Styled = styled.section`
  display: grid;
  text-align: center;
`;

// import Link from 'next/link';

const IndexPage = () => (
  <Layout heroSize={true} banner='home'>
    <About />
    <ImgBanner
      title='PRIVATE EVENTS'
      subtile='Planning a party? Let us do the work'
      btnTitle='view more'
      toLink='/privateEvents'
    />
    <Styled className='event section'>
      <img src='/event.png' alt='live music img' />
      <div className='event--content'>
        <TitleBanner
          topTitle='live music'
          title='Music & Event Inquiries'
          botTitle='get your jam on'
        />
        <p className='event--text'>
          Simone’s plays host to Chicago’s wide-ranging DJ and Music
          entertainment. The Lab is also available for private events. For more
          information:
        </p>
        <div className='event--content--contacts'>
          <p className='info'>musicbookings@simonesbar.com</p>
          <p className='info'>eventbookings@simonesbar.com</p>
          <p className='info'></p>
        </div>
      </div>
    </Styled>
  </Layout>
);

export default IndexPage;
